import Card from "../Card/Card";
import { useSelector } from "react-redux";

const CardsCont = () => {

    const pokemons = useSelector(state=> state.users);

    
    return (
        <div>
            { pokemons.map( poke => {
                return <Card
                nombre={poke.nombre}
                vida={poke.vida}
                />
            })}
        </div>
    )
}

export default CardsCont;
